import React from 'react';
import { useSelector } from 'react-redux';

const TodoItem = () => {
    const data = useSelector((state)=>state);
    console.log(data.todo);
    console.log(data.todo.length);
    data.map(res=>{
        console.log(res);
    })
    return(
        <div>
            <h1>{data.todo.length}</h1>
        </div>
    )
}

export default TodoItem;
